#include <bits/stdc++.h>

using namespace std;
class Solution {
public:
       int minJumps(vector<int>& arr) {
        int last = arr.size() -1;
        vector<vector<int>> edges (arr.size());
        unordered_map<int, vector<int>> m;
        for(int i=arr.size()-1; i>=0; i--){
            // vector<int> j ;
            // if(i>0)
            //     edges[i].push_back(i-1);
            // if(i<arr.size()-1)
            //     edges[i].push_back(i+1);
            m[arr[i]].push_back(i);
            // cout << arr[i] <<"-" << m[arr[i]].size() << endl;
        }

        set<int> accessedIdx;
        set<int> accessedVal;
        queue<pair<int, int>> q;
        q.push({0, 0});
        accessedIdx.insert(0);

        while(!q.empty()){
            auto [node, level] = q.front(); q.pop();
            // cout << node << ":" << level << endl;
            if(node == last)
                return level;

            // for(auto e: edges[node]) {
            //     if(accessedIdx.count(e) == 0){
            //         q.push({e, level+1});
            //         accessedIdx.insert(e);
            //     }
            // }
            if(node>0 && accessedIdx.count(node - 1) == 0){
                q.push({node - 1, level+1});
                accessedIdx.insert(node - 1);
            }
            if(node<arr.size()-1 && accessedIdx.count(node + 1) == 0){
                q.push({node + 1, level+1});
                accessedIdx.insert(node + 1);
            }
            if (accessedVal.count(arr[node]) == 0)
                for(auto e: m[arr[node]]) {
                    // cout << node <<"_" << e << endl;
                    if(accessedIdx.count(e) == 0) {
                        q.push({e, level+1});
                        accessedIdx.insert(e);
                    }
                }
            accessedVal.insert(arr[node]);

        }
        return -1;
    }
};

